import React from "react";
const Rates = ({ rate, setRate }) => {
  const data = ["1", "2", "3", "4", "5"];

  return (
    <>
      {data.map((number) => (
        <button
          onClick={() => setRate(number)}
          key={number}
          className={`evaluation-item ${rate === number && "active"}
          `}
        >
          {number}
        </button>
      ))}
    </>
  );
};

export default Rates;
